import "./App.css";
import React from "react";
import bg from "./images/bg.jpg";

function Moonproject() {
  return <div>#MoonProject</div>;
}

function App() {
  return (
    <div
      className="App"
      style={{ width: "100", height: "100vh", backgroundColor: "#000" }}
    >
      <div className="appbackgrounds"></div>
    </div>
  );
}

export default App;
